import React, { useState } from "react";

const OutputNode = ({ i }) => {
  const [color, setColor] = useState("cornflowerblue");

  const changeColor = (newColor) => setColor(newColor);

  return (
    <svg>
      {/* <g key={i}> */}
      <circle
        className="fill-green-400"
        cx={(i + 1) * (1000 / 9)}
        cy={0}
        r="40"
        // fill="transparent"
        onMouseOver={() => changeColor("coral")}
        onMouseOut={() => changeColor("cornflowerblue")}
      />
      <circle
        cx={(i + 1) * (1000 / 9)}
        cy={300}
        r="16"
        fill={color}
        onMouseOver={() => changeColor("coral")}
        onMouseOut={() => changeColor("cornflowerblue")}
      />
      {/* </g> */}
    </svg>
  );
};

export default OutputNode;
